import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import RoleSelectionPage from './RoleSelectionPage';
import ResumeAtsScorePage from './ResumeAtsScorePage';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={
            <div>
              <center>
                <h1>SkillBridge: Bridging the Gap to Your Dream Job</h1>
                <h2>A Web Application Powered by AWS</h2>
                <Link to="/role-selection">Select Your Role</Link>
              </center>
            </div>
          } />
          <Route path="/role-selection" element={<RoleSelectionPage />} />
          <Route path="/resume-ats-score" element={<ResumeAtsScorePage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
